import * as React from 'react';


export default function Header(props) {
    return (
        <header className="App-header">
            <a href="http://localhost:3000" className="App-link">
                <div className="container">
                    <div class="row">
                        <div class="col">
                            <h1 className="App-title">{props.pageTitle}</h1>
                        </div>
                    </div>

                </div>

            </a>
        </header>
    )
}
